import{o as t,c as e,a as i}from"./app.98c9ee76.js";const r='{"title":"La ressource qui permet de s\'enregister est détaillée comme suit:","description":"","frontmatter":{},"headers":[{"level":3,"title":"La ressource qui permet de s\'enregister est détaillée comme suit:","slug":"la-ressource-qui-permet-de-s-enregister-est-detaillee-comme-suit"}],"relativePath":"guide/auth/signIn.md","lastUpdated":1624556219069}',n={},d=i('<meta charset="utf-8"><h3 id="la-ressource-qui-permet-de-s-enregister-est-detaillee-comme-suit"><a class="header-anchor" href="#la-ressource-qui-permet-de-s-enregister-est-detaillee-comme-suit" aria-hidden="true">#</a> La ressource qui permet de s&#39;enregister est détaillée comme suit:</h3><br><br><h4 id="_1-resource-description"><a class="header-anchor" href="#_1-resource-description" aria-hidden="true">#</a> 1. Resource description</h4><p>Cette ressource permet de creer un nouvel utilisateur.</p><h4 id="_2-s-enregsitrer"><a class="header-anchor" href="#_2-s-enregsitrer" aria-hidden="true">#</a> 2. S&#39;enregsitrer</h4><p>Pour acceder à cette ressource, vous faites appel à l&#39;url suivante:</p><div class="language-"><pre><code>url: /register\n</code></pre></div><div class="danger custom-block"><p class="custom-block-title">Rappel</p><p>En utilisant la methode <code>POST</code></p></div><br><h4 id="_3-parametres"><a class="header-anchor" href="#_3-parametres" aria-hidden="true">#</a> 3. Paramètres</h4><p>Les diiferents parametres liées à cette ressource sont les suivants:</p><table><thead><tr><th>paramettre</th><th style="text-align:center;">Type</th><th>regle de validation</th><th style="text-align:right;">Description</th></tr></thead><tbody><tr><td>clientNumber</td><td style="text-align:center;">string</td><td>Optionnel</td><td style="text-align:right;">Numéro client créé dans la base à la souscription</td></tr><tr><td>entryDate</td><td style="text-align:center;">datetime</td><td>Optionnel</td><td style="text-align:right;">Date d’entrée en tant que client Bla Bli Blou (donnée liée à celle du Num client)</td></tr><tr><td>exerciceEntryDate</td><td style="text-align:center;">datetime</td><td>Optionnel</td><td style="text-align:right;">Date de début du 1er exercice traité en mission comptable par Blabliblou</td></tr><tr><td>clientStatus</td><td style="text-align:center;">string</td><td>Optionnel</td><td style="text-align:right;">Son statut en interne Bla Bli Blou</td></tr><tr><td>email</td><td style="text-align:center;">email</td><td>Obligatoire, Unique</td><td style="text-align:right;">C&#39;est le mail adresse de l&#39;utilisateur</td></tr><tr><td>password</td><td style="text-align:center;">string</td><td>Obligatoire</td><td style="text-align:right;">mot de passe client</td></tr><tr><td>clientName</td><td style="text-align:center;">string</td><td>Obligatoire</td><td style="text-align:right;">Nom juridique entreprise client</td></tr><tr><td>clientCommercialName</td><td style="text-align:center;">string</td><td>Obligatoire, Min: 4 characters</td><td style="text-align:right;">Nom commercial de l’entreprise client</td></tr><tr><td>clientSiret</td><td style="text-align:center;">string</td><td>Optionnel</td><td style="text-align:right;">Siret(Système d&#39;identification du répertoire des établissements) de l’entreprise</td></tr><tr><td>clientAddress</td><td style="text-align:center;">text</td><td>Optionnel</td><td style="text-align:right;">Adresse entreprise avec paramètres Num + rue + complément + code postal + ville</td></tr><tr><td>phone</td><td style="text-align:center;">string</td><td>Optionnel, Unique</td><td style="text-align:right;">Tel société principal</td></tr><tr><td>clientWebsite</td><td style="text-align:center;">string</td><td>Optionnel</td><td style="text-align:right;">Adresse site Web</td></tr><tr><td>clientComment</td><td style="text-align:center;">text</td><td>Optionnel</td><td style="text-align:right;">Facebook, instagram, pinterest, autre….</td></tr><tr><td>clientCreatedAt</td><td style="text-align:center;">datetime</td><td>Optionnel</td><td style="text-align:right;">Date de création de la structure juridique</td></tr><tr><td>ManagersIDs</td><td style="text-align:center;">json</td><td>Optionnel</td><td style="text-align:right;">Infos de chaque dirigeant de la société. Peut y en avoir plusieurs</td></tr><tr><td>clientExerciseDate</td><td style="text-align:center;">datetime</td><td>Optionnel</td><td style="text-align:right;">Date de clôture d’exercice comptable</td></tr><tr><td>clientCapital</td><td style="text-align:center;">decimal</td><td>Optionnel</td><td style="text-align:right;">Capital social ou rien</td></tr><tr><td>clientEmployerID</td><td style="text-align:center;">integer</td><td>Optionnel</td><td style="text-align:right;">Nombre de salariés</td></tr><tr><td>clientEmployersCount</td><td style="text-align:center;">???</td><td>Optionnel</td><td style="text-align:right;">???</td></tr><tr><td>clientSalariesNames</td><td style="text-align:center;">???</td><td>Optionnel</td><td style="text-align:right;">???</td></tr><tr><td>clientVatRegime</td><td style="text-align:center;">string</td><td>Optionnel, <br> valeurs permises: <strong>FRANCHISE, SIMPLIFIE, MINI-REEL, NORMAL</strong></td><td style="text-align:right;">Si franchise TVA, simplifié, Mini réel, Normal</td></tr><tr><td>clientVatPeriod</td><td style="text-align:center;">string</td><td>Optionnel,<br> valeurs permises: <strong>Année, trim, mois</strong></td><td style="text-align:right;">Si assujetti à la TVA,, quelle fréquence paiement</td></tr><tr><td>clientFiscalRegime</td><td style="text-align:center;">string</td><td>Optionnel, <br> valeurs permises: <strong>M, RS, RN</strong></td><td style="text-align:right;">Régime fiscal (M = MICRO, RS = REEL SIMPLIFIE ou RN = REEL NORMAL)</td></tr><tr><td>clientTaxRegime</td><td style="text-align:center;">string</td><td>Optionnel, <br> Valeurs permises: <strong>IR, IS</strong></td><td style="text-align:right;">Impôts sur revenus ou Société</td></tr><tr><td>clientBank</td><td style="text-align:center;">strings</td><td>Optionnel</td><td style="text-align:right;">Le ou les banques (il peut y avoir plusieurs compte) du client au format BANQUE</td></tr><tr><td>balanceSheetEntry</td><td style="text-align:center;">string</td><td>Optionnel</td><td style="text-align:right;">Il s’agit d’une table de données des données du dernier Bilan du client servant à récupérer les infos n-1</td></tr><tr><td>roles</td><td style="text-align:center;">json</td><td>Optionnel, <br> valeurs permises: <strong>USER (client), ADMIN_N (normal admin), ADMIN_P (Principal/Super admin)</strong></td><td style="text-align:right;">Rôle De l&#39;utilisateur</td></tr><tr><td>type</td><td style="text-align:center;">string</td><td>?</td><td style="text-align:right;">?</td></tr></tbody></table><br><h4 id="_4-requete-reussie"><a class="header-anchor" href="#_4-requete-reussie" aria-hidden="true">#</a> 4. Requête réussie</h4><p>Ci-dessous un exemple de rêquete passer avec succès en renseignant les champs nécessaires (Obligatoires):</p><div class="language-"><pre><code>\n{\n    &quot;clientNumber&quot;: &quot;60d4936452957&quot;,\n    &quot;entryDate&quot;: {\n        &quot;date&quot;: &quot;2021-03-26 00:00:00.000000&quot;,\n        &quot;timezone_type&quot;: 3,\n        &quot;timezone&quot;: &quot;UTC&quot;\n    },\n    &quot;exerciceEntryDate&quot;: {\n        &quot;date&quot;: &quot;2021-04-01 00:00:00.000000&quot;,\n        &quot;timezone_type&quot;: 3,\n        &quot;timezone&quot;: &quot;UTC&quot;\n    },\n    &quot;clientStatus&quot;: &quot;password&quot;,\n    &quot;email&quot;: &quot;aziz@gmail.com&quot;,\n    &quot;clientName&quot;: &quot;OFFRE&quot;,\n    &quot;clientCommercialName&quot;: &quot;Mohamed&quot;,\n    &quot;clientSiret&quot;: &quot;23561534&quot;,\n    &quot;clientAddress&quot;: &quot;Av. Abdellah ben Allal&quot;,\n    &quot;phone&quot;: &quot;212669081748&quot;,\n    &quot;clientWebsite&quot;: &quot;https://blabliblou.com&quot;,\n    &quot;clientComment&quot;: &quot;&quot;,\n    &quot;clientCreatedAt&quot;: &quot;2021-06-24&quot;,\n    &quot;ManagersIDs&quot;: null,\n    &quot;clientExerciseDate&quot;: {\n        &quot;date&quot;: &quot;2021-06-24 14:15:00.338341&quot;,\n        &quot;timezone_type&quot;: 3,\n        &quot;timezone&quot;: &quot;UTC&quot;\n    },\n    &quot;clientCapital&quot;: 100000,\n    &quot;clientEmployerID&quot;: 0,\n    &quot;clientVatRegime&quot;: &quot;&quot;,\n    &quot;clientVatPeriod&quot;: &quot;&quot;,\n    &quot;clientFiscalRegime&quot;: &quot;&quot;,\n    &quot;clientTaxRegime&quot;: &quot;&quot;,\n    &quot;clientBank&quot;: &quot;&quot;,\n    &quot;balanceSheetEntry&quot;: &quot;&quot;,\n    &quot;login&quot;: &quot;aziz@gmail.com&quot;\n}\n\n</code></pre></div><h4 id="_4-requete-echouee"><a class="header-anchor" href="#_4-requete-echouee" aria-hidden="true">#</a> 4. Requête echouée</h4><p>Ci-dessous un exemple d&#39;un échec de rêquete dans le cas d&#39;un email déjà existant:</p><div class="language-"><pre><code>{\n    &quot;email&quot;: &quot;Cette valeur est déjà utilisée.&quot;\n}\n\n</code></pre></div>',21);n.render=function(i,r,n,l,s,a){return t(),e("div",null,[d])};export default n;export{r as __pageData};
